"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[673],{7994:e=>{e.exports=JSON.parse('[{"id":"/2024/07/25/","metadata":{"permalink":"/blog/2024/07/25/","source":"@site/blog/2024-07-25.md","title":"Strecken-Sperrungen","description":"Liebe Athleten, liebe Zuschauer, liebe Anwohner,","date":"2024-07-25T00:00:00.000Z","formattedDate":"25. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Strecken-Sperrungen","authors":["orga"]},"unlisted":false,"nextItem":{"title":"Finisher Shirt 2024","permalink":"/blog/2024/07/08/TShirt"}},"content":"Liebe Athleten, liebe Zuschauer, liebe Anwohner,\\n\\nam Sonntag, den 28.07.2024, findet der 30. Heidelbergman statt. Wir freuen uns auf ein gro\xdfes Event und viele Zuschauer. Damit der Wettkampf f\xfcr alle Beteiligten reibungslos abl\xe4uft, bitten wir um Verst\xe4ndnis f\xfcr die notwendigen Strecken-Sperrungen.\\n\\nDie Strecken-Sperrungen sind wie folgt:\\n\\n![Strecken-Sperrungen-Schwimmen](/blog/sperrung_schwimmen.webp)\\n\\n![Strecken-Sperrungen-Radfahren](/blog/sperrung_rad.webp)\\n\\n![Strecken-Sperrungen-Laufstrecke](/blog/sperrung_laufen.webp)\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch!\\n\\n\ud83d\udd25RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg \\n\\n\ud83d\ude80Feiert mit uns das 30. JUBIL\xc4UM\ud83d\ude80"},{"id":"/2024/07/08/TShirt","metadata":{"permalink":"/blog/2024/07/08/TShirt","source":"@site/blog/2024-07-08-TShirt.md","title":"Finisher Shirt 2024","description":"Staffel","date":"2024-07-08T00:00:00.000Z","formattedDate":"8. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Finisher Shirt 2024","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Strecken-Sperrungen","permalink":"/blog/2024/07/25/"},"nextItem":{"title":"Pasta-Party","permalink":"/blog/2024/07/04/pasta"}},"content":"![Staffel](/blog/hdman24_shirt.jpg)\\n\\n\ud83d\udd25Finisher Shirt 2024\ud83d\udd25\\n\\nGemeinsam mit unserem Partner @yellowgreenteam haben wir das diesj\xe4hrige HDMan Finisher Shirt in der Jubil\xe4ums Edition designed.\ud83d\udd25\\n\\nZur Bestellung geht es hier: [Finisher Shirt 2024](https://yellowgreen.de/Teilnehmershirt-zum-HEIDELBERGMAN-2024/HDman2024Shirt)\\n\\nEs handelt sich um ein Unisex Sportshirt und kommt als slimfit Version. Es besteht aus zwei hochwertigen Funktionsstoffen. Die Front ist aus einem Polyestergewebe mit Microl\xf6chern gefertigt, der R\xfccken aus einem Polyestergewebe mit einer Meshstruktur zum besseren Feuchtigkeitstransport.\ud83d\udca7\ud83d\udca6\\n\\nDas Shirt hat ein Nackenband und enger geschnittene \xc4rmel.  Eine Gr\xf6\xdfentabelle findet ihr auf der Website von Yellogreen.\\nDie Rohstoffe wurden in der EU produziert und das Textil in der EU gefertigt. \ud83c\uddea\ud83c\uddfa\\n\\nEs besteht die M\xf6glichkeit, das Shirt im Vorverkauf mit dem Namen bedrucken zu lassen. \\nMaterial: 100% Polyester, Made in EU\\n\\nDas Teilnehmershirt kostet im Vorverkauf 25,- Euro und am Veranstaltungstag 30,- Euro. (So lange der Vorrat reicht). Das im Vorverkauf erworbene Shirt kann am Veranstaltungstag an unserem Verkaufsstand zusammen mit der Rechnung abgeholt werden. \\n\\nSchnell sein lohnt sich! \ud83d\ude80\\n\\n\ud83d\udd25 RACE DAY: 28.07.2024 \ud83d\udd25\\n\\n\ud83d\udccd Heidelberg\\n\\n\ud83d\ude80 Feiert mit uns das 30. JUBIL\xc4UM \ud83d\ude80"},{"id":"/2024/07/04/pasta","metadata":{"permalink":"/blog/2024/07/04/pasta","source":"@site/blog/2024-07-04-pasta.md","title":"Pasta-Party","description":"Staffel","date":"2024-07-04T00:00:00.000Z","formattedDate":"4. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Pasta-Party","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Finisher Shirt 2024","permalink":"/blog/2024/07/08/TShirt"},"nextItem":{"title":"Jetzt noch 30 Startpl\xe4tze sichern!","permalink":"/blog/2024/06/19/"}},"content":"![Staffel](/img/banner/Laufen.png)\\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d **Pasta-Party unterst\xfctzt von FALK** \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 Am 27.07. um 18:00 Uhr findet die Pasta-Party f\xfcr alle Teilnehmer des Heidelbergman Triathlons statt. \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nDen Anmeldelink f\xfcr die Pasta-Party findet ihr hier: [Anmeldung Pasta-Party](https://forms.office.com/r/3mbpLwkAvu)\\n\\nVielen Dank an FALK f\xfcr die Unterst\xfctzung bei der Pasta-Party! \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 \\\\\\nDatum: 27.07.2024 \\\\\\nZeit: 18:00 Uhr \\\\\\nOrt: Neckarwiese, Heidelberg \\\\\\n\\nFreut Euch auf: \\\\\\nLeckere Pasta-Variationen \\\\\\nErfrischende Getr\xe4nke \\\\\\nEine entspannte Atmosph\xe4re zum Austausch mit anderen Teilnehmern \\\\\\nMotivation und Tipps von erfahrenen Athlet:innen \\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d \\\\\\nKosten: \\\\\\nF\xfcr Helfer:innen: Kostenlos \\\\\\nF\xfcr Triathlet:innen: 2\u20ac pro Portion\\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\nDie Pastaparty ist die perfekte Gelegenheit, um sich gemeinsam auf den kommenden Wettkampf einzustimmen und sich mit Gleichgesinnten auszutauschen.\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nPS: Ihr k\xf6nnt gerne Freunde und Familie mitbringen!\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch! \ud83c\udf89\ud83c\udf89\ud83c\udf89\\n\\n![FALK](/img/sponsor/main/falk2019.jpg)"}]')}}]);